import React, {Component} from 'react';
import './Header.css';

class Header extends Component {

    render() {
        
        const menuList = this.props.menuItems.map(item => {
            return <li key={item.id}>{item.content}</li>
        })
        return (
            <div>
                <h1>HEader</h1>
                <header id="header">
                    {/* <div className="menu">
                    menu
                    </div> */}
                    <nav>
                        <ul>
                            {menuList}
                        </ul>
                    </nav>
                </header>
            </div>
        )
    }
}

export default Header
